import { Typography } from '@mui/material';
import React from 'react';
import "../style/home.css";

function Home() {
  return (
    <div className='home'>
        <Typography variant='h3'>
          Welcome to
        </Typography>
        <Typography variant='h1'>
          Shelter X
        </Typography>
    </div>
  )
}

export default Home
